import React from "react";
import ReactDOM from "react-dom";
import {BrowserRouter} from 'react-router-dom';
import App from "./App";

console.log(window.location.href);

ReactDOM.render(
    <>
    <BrowserRouter>
      <App />
    </BrowserRouter>
    </>,
    document.getElementById("root")
)
